import QuizCard from '../components/QuizCard'
import QuizPage from '../components/QuizCard'

const QuizesPage = () => {

	const Quizzes = [
		{color: '#68b5e8', progress: 90, id: 1},
		{color: '#68b5e8', progress: 80, id: 2},
		{color: '#68b5e8', progress: 20, id: 3},
		{color: '#68b5e8', progress: 50, id: 4},
		{color: '#68b5e8', progress: 100, id: 5},
	]


	return(
		<div className='bg-gray-900'>
			{Quizzes.map((level)=> <QuizCard key={level.id} color={level.color} progress={level.progress}/>)}
		</div>
	)
}

export default QuizesPage
